;a:5:{s:4:\"data\";s:381:\"<p>A WordPress plugin that integrates Shmart payment service which is popular in India, with your Easy Digital Downloads store.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/shmart-payment-gateway-easy-digital-downloads-plugin/\">Introducing Shmart Addon for Easy Digital Downloads</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Aditya Kane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2714:\"<p><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/edd/2015/10/shmart.jpg\" rel=\"lightbox[119261]\"><img class=\"size-full wp-image-121606 alignright\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/edd/2015/10/shmart.jpg\" alt=\"shmart\" width=\"240\" height=\"240\" /></a>It has been a year, since <a href=\"https://rtcamp.com/blog/moving-woocommerce-easydigitaldownloads/\">we started using Easy Digital Downloads</a>. Since we are based out of India, we wanted to make it easy for our Indian users to make payments using Shmart payment gateway.</p>\n<p>Shmart is an Indian payment gateway. It allows users to make payments in INR currency. You can check out more details at <a href=\"http://shmart.in\">shmart.in</a>. In India Shmart is one of the few payment gateway which allows to sell software.</p>\n<h2>Shmart Addon for Easy Digitial Downloads plugin</h2>\n<p>Since there was no ready made solution, we developed an addon for Easy Digital Downloads that allows users to accept money in INR currency using Shmart service from India.</p>\n<p>We have been using this addon on our own store along with Easy Digital Download for a while now. After polishing the code a bit, we are now releasing it as an premium plugin.</p>\n<p>Here is a short video demo of the plugin.</p>\n<p><iframe class=\"wistia_embed\" src=\"//fast.wistia.net/embed/iframe/5qyo4thqlz\" name=\"wistia_embed\" width=\"770\" height=\"461\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe><br />\n<script src=\"//fast.wistia.net/assets/external/E-v1.js\" async=\"\"></script></p>\n<h2>Requirements</h2>\n<ul>\n<li>Your website will require <a href=\"https://wordpress.org/plugins/easy-digital-downloads/\">Easy Digital Download</a> plugin.</li>\n<li>Shmart approved account to get all the required keys.</li>\n<li><a href=\"https://openexchangerates.org/\" rel=\"nofollow\">https://openexchangerates.org/</a> free or paid API access to convert foreign currency into INR.</li>\n</ul>\n<p>The price of this plugin is $49 USD for a single site licence.</p>\n<p>You can read the complete <a href=\"http://docs.rtcamp.com/easydigitaldownloads-shmart-payment-gateway/\">documentation here</a>.</p>\n<p><a class=\"primary button\" href=\"https://rtcamp.com/products/easydigitaldownloads-shmart-payment-gateway/\">BUY PLUGIN</a></p>\n<p><strong>Related: </strong>Are you running an e-commerce store on WordPress? Try out <a href=\"https://rtcamp.com/products/rtbiz-helpdesk/\">rtBiz Helpdesk</a>.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/shmart-payment-gateway-easy-digital-downloads-plugin/\">Introducing Shmart Addon for Easy Digital Downloads</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://rtcamp.com/blog/shmart-payment-gateway-easy-digital-downloads-plugin/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"rtCamp’s Origin story on HeroPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://rtcamp.com/blog/our-origin-story-on-heropress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://rtcamp.com/blog/our-origin-story-on-heropress/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Oct 2015 17:30:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=121215\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:361:\"<p>Rahul is Founder &#038; CEO of rtCamp, hence his essay even though is about his WordPress journey, it also in many ways is rtCamp\'s story.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/our-origin-story-on-heropress/\">rtCamp&#8217;s Origin story on HeroPress</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Aditya Kane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1344:\"<p>Since WordPress is not exactly taught in colleges, exposure to it and it&#8217;s awesome community is often by accident. Most of these happy accidents have wonderful stories behind them. One great place to read interesting WordPress stories is a nice website called HeroPress.</p>\n<p><a href=\"http://heropress.com\">HeroPress</a> is an initiative started by <a href=\"https://twitter.com/topher1kenobe\">Topher DeRossia</a>, who a lot of rtCampers recently met at <a href=\"https://rtcamp.com/blog/how-we-rtcamped-at-wordcamp-pune-2015/\">WordCamp Pune</a>. We loved listening to his story of how HeroPress came about.</p>\n<p>He also asked our very own Rahul Bansal, to recount how he started using WordPress and a bit about the challenges with perceptions of being a WordPress agency from India.</p>\n<p>Rahul is Founder &amp; CEO of rtCamp, hence his essay even though is about his WordPress journey, it also in many ways is rtCamp&#8217;s story.</p>\n<p>You can read Rahul&#8217;s essay titled <a href=\"http://heropress.com/essays/wordpress-continues-inspire/\">&#8220;WordPress continues to inspire!&#8221; on HeroPress</a>.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/our-origin-story-on-heropress/\">rtCamp&#8217;s Origin story on HeroPress</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://rtcamp.com/blog/our-origin-story-on-heropress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:57:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"10% Store Discount on purchase of 5 rtCamp Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://rtcamp.com/blog/10-percent-store-discount/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://rtcamp.com/blog/10-percent-store-discount/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 29 Sep 2015 12:46:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:6:{i:0;a:5:{s:4:\"data\";s:5:\"Promo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:9:\"Discounts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:10:\"EasyEngine\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:5:\"rtbiz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:7:\"rtMedia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:9:\"WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=119417\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:371:\"<p>Buy 5 or more products, we apply a 10% flat discount on each product.<br />\nBuy 3 or 4 products, we apply a 5% flat discount on each product.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/10-percent-store-discount/\">10% Store Discount on purchase of 5 rtCamp Products</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Aditya Kane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2324:\"<p>We have more than 50 products on rtCamp. The price of most products start from $19 USD upto $199 USD. A lot of our products are related to each other and often many customers buy more than one product. Often we see someone buying 3 or 5 plugin add-ons and <a href=\"https://rtcamp.com/products/category/themes/\">themes</a> from our store.</p>\n<p>To make things easy, we already have some nice <a href=\"https://rtcamp.com/products/category/product-bundle/\">product bundles</a> that you can purchase as a lower price than what you would have spent on buying them individually. But bundles usually are have common or related plugins involved.</p>\n<p><a href=\"https://rtcamp.com/products/\"><img class=\"aligncenter size-full wp-image-119538\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/rtCamp-discount-10-percent.png\" alt=\"rtCamp-discount-10-percent\" width=\"680\" height=\"359\" /></a></p>\n<p>So recently, we have started giving a discount to each and every user who wants to purchase our products and services <em>(eg:  EasyEngine installation, media node installation, etc)</em> a discount of 5 to 10% based on the number of products purchased.</p>\n<h2>How the discount works!</h2>\n<ul>\n<li>Buy 3 or 4 products, we are giving a 5% flat discount on each product.</li>\n<li>Buy 5 or more products, we are giving a 10% flat discount on each product.</li>\n</ul>\n<p>These discounts are applied <strong>only on products that are in the cart.  </strong>The value calculated with applied discount will be displayed on checkout page for each product added in cart.</p>\n<p><a href=\"https://rtcamp.com/products/\"><img class=\"aligncenter wp-image-119421 size-large\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/Screenshot-720x428.png\" alt=\"5%-discount\" width=\"640\" height=\"380\" /></a></p>\n<p>Purchase number of products from our <a href=\"https://rtcamp.com/products/\">store</a> and get 5% or 10% discount.</p>\n<p>If you have any pre-sale questions about products and installation services, feel free to <a href=\"https://rtcamp.com/contact/#presale\">contact us</a>.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/10-percent-store-discount/\">10% Store Discount on purchase of 5 rtCamp Products</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://rtcamp.com/blog/10-percent-store-discount/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:54:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"We have bbPress attachment feature you are looking for!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://rtcamp.com/blog/we-have-bbpress-attachment-feature/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://rtcamp.com/blog/we-have-bbpress-attachment-feature/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 15 Sep 2015 13:05:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"bbPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:19:\"bbPress attachments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:7:\"rtMedia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:9:\"WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=118410\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:393:\"<p>A recent bbPress survey showed bbPress attachment is most requested feature. Our premium rtMedia bbPress attachment plugin already offers it and more!</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/we-have-bbpress-attachment-feature/\">We have bbPress attachment feature you are looking for!</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Nitun Lanjewar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4039:\"<p>Results of the yearly bbPress survey are out. Overall 213 people participated in it from 41 countries. The survey results are supposed to give guidance to future plugin development around bbPress ecosystem. You can read the <a href=\"https://bbpress.org/blog/2015/09/2015-bbpress-survey-results/\">official blog post about the survey here</a>.</p>\n<p>What caught our attention was <strong>attachments</strong> on topics/replies being most demanded feature. This caught our attention because we have a <a href=\"https://rtcamp.com/products/rtmedia-bbpress-attachments/\">rtMedia bbPress attachment </a>premium addon as part of our own <a href=\"https://rtcamp.com/rtmedia\">rtMedia project</a>.</p>\n<p>Thought rtMedia is popular among BuddyPress sites, it works without BuddyPress as well for WordPress / bbPress sites.</p>\n<h2>rtMedia bbPress Attachment</h2>\n<p><a href=\"https://rtcamp.com/products/rtmedia-bbpress-attachments/\"><img class=\"alignright size-full wp-image-85696\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/edd/2015/06/rtmedia-bbpress-attachments.jpg\" alt=\"rtmedia-bbpress-attachments\" width=\"240\" height=\"240\" /></a>This addon provides attachment support for bbPress forum topics and replies.</p>\n<p>It supports multiple attachments and thumbnail preview for media attachments. If you upload audio/video attachments, they can gets converted to web-friendly format using our <a href=\"https://rtcamp.com/rtmedia/audio-video-encoding-service/\">free audio/video transcoding service</a> which is already integrated into rtMedia platform.</p>\n<p>Apart from media attachment, the plugin provides <a href=\"http://docs.rtcamp.com/rtmedia/addons/rtmedia-bbpress-attachments/actions.html\">actions</a> and <a href=\"http://docs.rtcamp.com/rtmedia/addons/rtmedia-bbpress-attachments/filters.html\">filters</a> so you can do additional stuff to meet your needs.</p>\n<p>Below is video explaining plugin features:</p>\n<div id=\"video\"><iframe class=\"wistia_embed\" src=\"//fast.wistia.net/embed/iframe/bc13rbpdrx\" name=\"wistia_embed\" width=\"770\" height=\"433\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"></iframe></div>\n<div></div>\n<div><script src=\"//fast.wistia.net/assets/external/E-v1.js\" async=\"\"></script></div>\n<div>If a feature is not clear, feel free to <a href=\"https://rtcamp.com/contact/\">contact us</a> or drop a comment below.</div>\n<div></div>\n<h2>rtMedia powers 20% of BuddyPress Sites</h2>\n<p>If you are new to rtMedia or never heard of it before, I would just like to inform you that rtMedia is running on 20,000 active installs. As it is used mostly by BuddyPress sites, it now powers 20% or better put 1 in every 5 BuddyPress site.</p>\n<p>That being said, if you are using bbPress alone, you can still use rtMedia. Only thing you may feel wrong is plugin slug which is still &#8220;buddypress-media&#8221;! Rest  assured, it doesn&#8217;t need BuddyPress anymore. <img src=\"https://rtcamp.com/wp-includes/images/smilies/simple-smile.png\" alt=\":-)\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<h3>Why two plugins instead of one?</h3>\n<p>You may wonder why we did not build bbPress attachment as independent plugin!</p>\n<p>Our rtMedia (free version) acts as a media framework and makes many things e.g. audio/video encoding service, JSON API available. So with this approach you basically get more power and features that a standalone bbPress plugin might find impractical to offer! <img src=\"https://rtcamp.com/wp-includes/images/smilies/simple-smile.png\" alt=\":-)\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<p><strong>Links:</strong> <a href=\"https://rtcamp.com/products/rtmedia-bbpress-attachments/\">rtMedia bbPress attachment</a> | <a href=\"https://rtcamp.com/rtmedia/\">rtMedia</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/we-have-bbpress-attachment-feature/\">We have bbPress attachment feature you are looking for!</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://rtcamp.com/blog/we-have-bbpress-attachment-feature/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:54:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"How we rtCamped at WordCamp Pune 2015\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://rtcamp.com/blog/how-we-rtcamped-at-wordcamp-pune-2015/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://rtcamp.com/blog/how-we-rtcamped-at-wordcamp-pune-2015/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 11 Sep 2015 16:08:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"Events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:8:\"WordCamp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:13:\"WordCamp Pune\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:19:\"WordPress Community\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=118219\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:375:\"<p>rtCamp was involved at WordCamp Pune 2015 as sponsors, some were volunteering and even speaking. Here is a look at our WordCamp experience in Pune.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/how-we-rtcamped-at-wordcamp-pune-2015/\">How we rtCamped at WordCamp Pune 2015</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Aditya Kane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5641:\"<p>It would be incredibly unfair to really write about rtCamp&#8217;s experience at <a href=\"http://pune.wordcamp.org/2015\">WordCamp Pune 2015</a> in a single post. This is because there were 30+ experiences at WordCamp Pune. Everyone has a unique one and some of us have written about it on their personal blogs.</p>\n<h2>Pune is home!</h2>\n<p>For rtCamp, the city of Pune is home. We do have remote workers but mainly our offices are based out of Pune. Rahul Bansal our CEO was an organiser along with Dinesh Jain and Ganesh Kerkar. Rahul was in charge of food! He manned the food stalls like a real pro and got those sandwiches out to people really fast.</p>\n<p>Here is a photo of Rahul in his elements.</p>\n<p><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/rahul-lunch-management-wcpune.jpg\" rel=\"lightbox[118219]\"><img class=\"alignnone wp-image-118220\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/rahul-lunch-management-wcpune-720x480.jpg\" alt=\"rahul-lunch-management-wcpune\" width=\"640\" height=\"427\" /></a></p>\n<p><em>Image Credit: <a href=\"https://www.facebook.com/photo.php?fbid=1158697057478154\">Anand Thakkar</a></em></p>\n<p>We were also involved as sponsors at this WordCamp. Thus, we had a nice sponsor desk to use. We did not really have many freebies to give out but decided to distribute <a href=\"https://rtcamp.com/rtbiz/helpdesk/\">rtBiz Helpdesk</a>, a premium plugin free to anyone interested.</p>\n<p>This was a blessing in disguise for many rtCampers.</p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">Visit us at our desk at <a href=\"https://twitter.com/hashtag/WCPune?src=hash\">#WCPune</a>. There&#39;s a free licence of our Helpdesk plugin we are giving away <a href=\"http://t.co/XVscdYto9j\">pic.twitter.com/XVscdYto9j</a></p>\n<p>&mdash; rtCamp (@rtCamp) <a href=\"https://twitter.com/rtCamp/status/640413764815351808\">September 6, 2015</a></p></blockquote>\n<p><script async src=\"//platform.twitter.com/widgets.js\" charset=\"utf-8\"></script></p>\n<p>A lot of rtCampers are introverts and hence do not usually make the first move towards starting a conversation. The giveaway intrigued many and got people asking different sorts of questions to many rtCampers about WordPress, plugins, working in open-source and more.</p>\n<p>I hardly attended any sessions as I was often at the sponsor desk. But I did catch <a href=\"https://twitter.com/topher1kenobe\">Topher DeRossia</a> speak about HeroPress. His has been on an extra-ordinary journey and I would highly recommend you to take time and read contributor essays on the <a href=\"http://heropress.com\">HeroPress website</a>.</p>\n<p>Here is Topher posing with rtCampers for a selfie!</p>\n<figure id=\"attachment_118221\" style=\"width: 640px;\" class=\"wp-caption alignnone\"><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/rtCampers-Topher-Heropress.jpg\" rel=\"lightbox[118219]\"><img class=\"wp-image-118221\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/rtCampers-Topher-Heropress-720x480.jpg\" alt=\"rtCampers-Topher-Heropress\" width=\"640\" height=\"427\" /></a><figcaption class=\"wp-caption-text\">rtCampers with Topher from HeroPress</figcaption></figure>\n<h2>Thanks to the Organisers and Volunteers!</h2>\n<p>There were several organisers and volunteers who worked through out the day. They never once stopped making all of us feel welcomed and part of this WordCamp. A big thank you to these guys.</p>\n<figure id=\"attachment_118228\" style=\"width: 640px;\" class=\"wp-caption alignnone\"><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/WCPune-Organisers.jpg\" rel=\"lightbox[118219]\"><img class=\"wp-image-118228 size-large\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/WCPune-Organisers-720x480.jpg\" alt=\"WCPune-Organisers\" width=\"640\" height=\"427\" /></a><figcaption class=\"wp-caption-text\">WordCamp Pune 2015 organisers and volunteers</figcaption></figure>\n<h2>rtCampers on WordCamp Pune</h2>\n<figure id=\"attachment_118229\" style=\"width: 640px;\" class=\"wp-caption alignnone\"><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/rtCampers-WCPune.jpg\" rel=\"lightbox[118219]\"><img class=\"wp-image-118229 size-large\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/rtCampers-WCPune-720x480.jpg\" alt=\"rtCampers-WCPune\" width=\"640\" height=\"427\" /></a><figcaption class=\"wp-caption-text\">That&#8217;s all of us at WordCamp Pune</figcaption></figure>\n<p>Many folks at rtCamp have started writing down their thoughts about the event on their personal blogs. You can read them for a more individual perspective on their experiences.</p>\n<ul>\n<li><a href=\"http://rahul286.com/blog/my-first-wordcamp-as-an-organiser/\">Rahul Bansal on his experience as a first time organiser</a>.</li>\n<li><a href=\"http://bombaypirate.com/wordcamp-pune-2015/\">My own blog post about WordCamp Pune and withdrawal symptoms!</a></li>\n<li><a href=\"http://connect2dips.com/wordcamp-pune-2015/\">Dipesh Kakadiya noted somethings he enjoyed.</a></li>\n</ul>\n<p>I will keep adding more to the list as rtCampers take time off and write about their WordCamp Pune adventures. <img src=\"https://rtcamp.com/wp-includes/images/smilies/simple-smile.png\" alt=\":-)\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<p><strong>Link:</strong> <a href=\"http://pune.wordcamp.org/2015\">WordCamp Pune 2015</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/how-we-rtcamped-at-wordcamp-pune-2015/\">How we rtCamped at WordCamp Pune 2015</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://rtcamp.com/blog/how-we-rtcamped-at-wordcamp-pune-2015/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:51:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Meet rtCamp at WordCamp Pune 2015\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://rtcamp.com/blog/meet-rtcamp-wordcamp-pune-2015/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://rtcamp.com/blog/meet-rtcamp-wordcamp-pune-2015/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 04 Sep 2015 15:11:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:5:\"rtbiz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:8:\"WordCamp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:13:\"WordCamp Pune\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=117578\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:369:\"<p>Meet us at WordCamp Pune 2015 at our sponsor desk. We will be happy to offer you personalised demo and a free license for rtBiz Helpdesk premium plugin.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/meet-rtcamp-wordcamp-pune-2015/\">Meet rtCamp at WordCamp Pune 2015</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Aditya Kane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2220:\"<p><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/WCPune-Logo.png\" rel=\"lightbox[117578]\"><img class=\"alignright wp-image-117580\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/09/WCPune-Logo.png\" alt=\"WCPune-Logo\" width=\"300\" height=\"300\" /></a>One thing we love at rtCamp is meeting fellow WordPress and FOSS enthusiasts. We have our physical office in Pune and hence <a href=\"https://pune.wordcamp.org/2015/\">WordCamp Pune being held on 6th September, 2015</a> is very close to our heart.</p>\n<p>Pune has a very active WordPress community. There are several freelancers and many small &amp; medium sized companies who work on WordPress here. It is no surprise that the majority of WordPress core contributions from India are from people living in Pune.</p>\n<p>So rtCampers are really looking forward to meet all types of WordCampers at WordCamp Pune.</p>\n<h2>Say Hello!</h2>\n<p>The organisers have been kind enough to give us a sponsor desk at the venue.</p>\n<p>We will have many rtCampers available at the desk. If you want to discuss anything about WordPress, get a demo of our products or are curious about working with us, do feel free to approach us and say &#8220;Hello&#8221; to someone at the rtCamp sponsor desk.</p>\n<h2>Free rtBiz License</h2>\n<p>If you ever wanted a full-fledged helpdesk on WordPress, you may like to try our latest premium WordPress plugin called <a href=\"https://rtcamp.com/rtbiz/helpdesk/\">rtBiz Helpdesk</a>.  At WordCamp Pune, you can get a demo and one-year free license for the same. <img src=\"https://rtcamp.com/wp-includes/images/smilies/simple-smile.png\" alt=\":-)\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<p>Hope to see you very soon at WordCamp Pune 2015. <img src=\"https://rtcamp.com/wp-includes/images/smilies/simple-smile.png\" alt=\":-)\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<p><strong>Link:</strong> <a href=\"https://pune.wordcamp.org/2015/\">WordCamp Pune 2015</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/meet-rtcamp-wordcamp-pune-2015/\">Meet rtCamp at WordCamp Pune 2015</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://rtcamp.com/blog/meet-rtcamp-wordcamp-pune-2015/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:54:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Introducing rtMedia SEO Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://rtcamp.com/blog/introducing-rtmedia-seo-plugin/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://rtcamp.com/blog/introducing-rtmedia-seo-plugin/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 01 Sep 2015 12:33:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:10:\"BuddyPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:7:\"rtMedia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:3:\"SEO\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:7:\"sitemap\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=116928\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:357:\"<p>Make rtMedia images, video and music files searchable using rtMedia SEO plugin. Generate a sitemap and submit to search engine webmaster tools.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/introducing-rtmedia-seo-plugin/\">Introducing rtMedia SEO Plugin</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Nitun Lanjewar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2568:\"<p>Today we are releasing a premium WordPress plugin, rtMedia SEO. This plugin is useful for generating an XML sitemap of all the media files uploaded via rtMedia uploader.</p>\n<p>Additionally we have taken care of privacy for media files. Only for public media files <em>(audio, video photos, and documents)</em> a sitemap will be generated.</p>\n<h2>Using this plugin</h2>\n<p>With rtMedia plugin, media files do not show up in search engine results. Many users want it this way; as rtMedia is used with BuddyPress and getting listed on search engines is not always a priority or desirable. But options are always good to have.</p>\n<p>So with rtMedia SEO plugin, site admins can generate a sitemap and submit it to webmaster tools of Google, Yahoo, Bing and more.</p>\n<div id=\"wistia_jde96r9s52\" class=\"wistia_embed\" style=\"width: 720px; height: 433px;\"> Here is a <a href=\"https://rtcamp.wistia.com/medias/jde96r9s52\">video introduction of rtMedia SEO plugin</a>.</div>\n<p><script src=\"//fast.wistia.com/assets/external/E-v1.js\" charset=\"ISO-8859-1\"></script><script>// <![CDATA[\nwistiaEmbed = Wistia.embed(\"jde96r9s52\");\n// ]]&gt;</script></p>\n<p>If you are already using <a href=\"http://wordpress.org/plugins/wordpress-seo\">Yoast SEO</a> plugin,  then rtMedia SEO plugin merges sitemaps with Yoast Sitemaps and on the same page you can find all the sitemap XML pages.</p>\n<h2>Pricing and License</h2>\n<p>Single site license for rtMedia SEO plugin starts at $29 <em>(USD). </em>This one year license includes free upgrade and premium support.</p>\n<p>Keep license key activated on your site to receive update notifications.</p>\n<h2>Future Roadmap</h2>\n<ol>\n<li>An index/noindex option for meta and titles.</li>\n<li>A nofollow option for rtMedia generated pages.</li>\n<li>Sitemap support for &#8220;All in One SEO pack&#8221; plugin.</li>\n</ol>\n<p><a href=\"https://rtcamp.com/subscribe/?newsletter-topic=buddypress\">Subscribe to our newsletter</a> for further updates.</p>\n<p>Let us know your views and new feature requests in our <a href=\"https://rtcamp.com/idea/\">idea section</a>.</p>\n<p><a class=\"primary button\" href=\"https://rtcamp.com/products/rtmedia-seo/\">BUY NOW</a></p>\n<p><b>Links: </b><a href=\"http://community.rtcamp.com/c/pre-sales\">Presale</a> | <a href=\"http://docs.rtcamp.com/rtmedia/addons/rtmedia-seo.html\">Documentation</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/introducing-rtmedia-seo-plugin/\">Introducing rtMedia SEO Plugin</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://rtcamp.com/blog/introducing-rtmedia-seo-plugin/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:48:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Introducing Email Only Support with rtBiz Helpdesk\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://rtcamp.com/blog/email-only-support-rtbiz-helpdesk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://rtcamp.com/blog/email-only-support-rtbiz-helpdesk/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 26 Aug 2015 13:26:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:5:\"rtbiz\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:16:\"wordpress plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=116807\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:433:\"<p>A support ticket is automatically created by rtBiz Helpdesk while someone emails your support. With Email only support the customer receives a reply only via email for a more personal experience. </p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/email-only-support-rtbiz-helpdesk/\">Introducing Email Only Support with rtBiz Helpdesk</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Aditya Kane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2692:\"<p>rtBiz Helpdesk is perfect for giving support to your customers from your WordPress dashboard. Its web interface makes it very easy for staff to give support and manage tickets.</p>\n<p>But many of our Helpdesk owners wanted to make the customer side of experience a little more personal and simpler. This is why we are adding email-only support to rtBiz Helpdesk plugin.</p>\n<h2>Email Only Support</h2>\n<p>The idea is to let customers get support without leaving the comfort of their mailbox. They would no longer require to create an account on your Helpdesk or login to create tickets.  All Helpdesk communication will now be like a regular mail communication.</p>\n<p>This means it will be easier for your customers to communicate with your staff, without knowing about the Helpdesk layer. This makes the support experience more personal and unique.</p>\n<p>See this video to see the email-only support in action:</p>\n<div id=\"wistia_n7hbjerrjq\" class=\"wistia_embed\" style=\"width: 640px; height: 388px;\"></div>\n<p><script src=\"//fast.wistia.com/assets/external/E-v1.js\" charset=\"ISO-8859-1\"></script><script>// <![CDATA[\nwistiaEmbed = Wistia.embed(\"n7hbjerrjq\");\n// ]]&gt;</script></p>\n<p><a href=\"http://docs.rtcamp.com/rtbiz/helpdesk/admin/mailbox/email_only_support.html\">Read Documentation </a></p>\n<p>There is also support added if you want to make your Helpdesk  <em>Email Only</em> or <em>Web only </em>or <em>Email+Web</em>.</p>\n<h3>Pricing</h3>\n<p>We are constantly adding new features to rtBiz Helpdesk to make it more productive for your team and easy for your customers to use.  We will marginally increase the cost with every major feature we release. So with this release, the plugin price will be revised to USD 39 from 1st September, 2015.  We hope you will love the new features we will be adding constantly.  <img src=\"https://rtcamp.com/wp-includes/images/smilies/simple-smile.png\" alt=\":-)\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n<h3 id=\"have-suggestions\">Have Suggestions?</h3>\n<p>Reach out this link and submit the features you would like us to implement <a href=\"https://rtcamp.com/idea/\">https://rtcamp.com/idea/</a>.</p>\n<p>Learn more about <a href=\"https://rtcamp.com/rtbiz/helpdesk/\">rtBiz Helpdesk here</a>.</p>\n<p><a class=\"primary button\" href=\"https://rtcamp.com/products/rtbiz-helpdesk/\">BUY HELPDESK</a><a class=\"button\" href=\"http://demo.rtcamp.com/rtbiz-helpdesk/\">LIVE DEMO</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/email-only-support-rtbiz-helpdesk/\">Introducing Email Only Support with rtBiz Helpdesk</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://rtcamp.com/blog/email-only-support-rtbiz-helpdesk/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"WordPress 4.3 with contributions by rtCampers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://rtcamp.com/blog/wordpress-4-3-contributions-rtcampers/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://rtcamp.com/blog/wordpress-4-3-contributions-rtcampers/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 20 Aug 2015 09:11:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:27:\"Wordpress Core Contribution\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=115859\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:383:\"<p>WordPress 4.3 is released with some great features. It is also the 8th consecutive release where an rtCamper has been contributing a patch towards.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/wordpress-4-3-contributions-rtcampers/\">WordPress 4.3 with contributions by rtCampers</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Aditya Kane\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3471:\"<p><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/08/WordPress_4_3.png\" rel=\"lightbox[115859]\"><img class=\"alignnone wp-image-115866 size-full\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/08/WordPress_4_3.png\" alt=\"WordPress 4.3\" width=\"666\" height=\"386\" /></a></p>\n<p>Yesterday, WordPress 4.3 &#8220;Billie&#8221; was released. In WordPress tradition it was named after a famous jazz musician and it was after Billie Holiday for this version.</p>\n<p>WordPress 4.3 has some really great features. Menus in Customizer, options for creating better passwords, options of adding site icons and several other improvements. A favourite for many rtCampers is the introduction of formatting shortcuts. These look a lot like markdown which is hugely popular with many developers.</p>\n<p>You can read more about <a href=\"https://wordpress.org/news/2015/08/billie/\">WordPress 4.3 in its release post</a>.</p>\n<h2>rtCamper contributions</h2>\n<p>WordPress 4.3 was the 8th consecutive version we have had someone contribute to core WordPress. Five rtCampers namely, <a href=\"https://profiles.wordpress.org/ankit-k-gupta\">Ankit K Gupta</a>, <a href=\"https://profiles.wordpress.org/sagarjadhav\">Sagar Jadhav</a>, <a href=\"https://profiles.wordpress.org/dipeshkakadiya\">Dipesh Kakadiya</a>, <a href=\"https://profiles.wordpress.org/ritteshpatel\">Ritesh Patel</a> and <a href=\"https://profiles.wordpress.org/pareshradadiya-1\">Paresh Radadiya</a> contributed patches this time around.</p>\n<p>In what has become tradition for us, we cut a cake with their patch numbers on it at our office.</p>\n<p><a href=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/08/WordPress_43_cake_contributions.jpg\" rel=\"lightbox[115859]\"><img class=\"alignnone wp-image-115861 size-full\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/08/WordPress_43_cake_contributions.jpg\" alt=\"Our WordPress contribution cake\" width=\"601\" height=\"601\" /></a></p>\n<p>It is also great to see a lot of ex-rtCampers in the list of contributors.</p>\n<h2>More than one way to contribute to WordPress</h2>\n<p>We at rtCamp have always been encouraging everyone to contribute to open-source software in more way than one. There are more than one way to contribute to WordPress. WordCamps and taking part in meetups is one great way to contribute to the local WordPress community. At <a href=\"http://pune.wordcamp.org/2015\">WordCamp Pune</a>, we will have many rtCampers as speakers, organisers and volunteers. We are also sponsors at the event.</p>\n<p>If you are a visiting WordCamp Pune, find an rtCamper and say &#8220;Hello&#8221; or drop by our sponsor desk.</p>\n<h2 id=\"compatibility-with-wordpress-42\">Compatibility with WordPress 4.3</h2>\n<p>We have been testing our plugins with WordPress 4.3 and they all work great with the new version. In case you have any questions or concerns feel free to <a href=\"https://rtcamp.com/premium-support/\">raise a support ticket</a> for your product.</p>\n<p><strong>Link:</strong> <a href=\"https://wordpress.org/news/2015/08/billie/\">WordPress 4.3  Release Post</a> | <a href=\"https://rtcamp.com/blog/tag/wordpress-core-contribution/\">rtCamp’s WordPress Core Contributions Archive</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/wordpress-4-3-contributions-rtcampers/\">WordPress 4.3 with contributions by rtCampers</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://rtcamp.com/blog/wordpress-4-3-contributions-rtcampers/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:48:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"New Updates with rtMedia v 3.8.15 and Addons\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://rtcamp.com/blog/introducing-rtmedia-v3-8-15-addons/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://rtcamp.com/blog/introducing-rtmedia-v3-8-15-addons/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 18 Aug 2015 15:09:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:4:\"News\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:10:\"BuddyPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:7:\"rtMedia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"https://rtcamp.com/?p=115583\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:363:\"<p>rtMedia free version 3.8.15 and other premium addons released with bug fixes, hooks provided along with photo tagging of user list.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/introducing-rtmedia-v3-8-15-addons/\">New Updates with rtMedia v 3.8.15 and Addons</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Nitun Lanjewar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4362:\"<p>Today we are releasing rtMedia V 3.8.15 and also some updates to a few our premium addons. In these releases we have added some hooks, bug fixes and minified version of JS &amp; CSS files.</p>\n<h2>rtMedia Free</h2>\n<p>In version 3.8.15, two hooks has been added along with some CSS fixes. You can download or auto update from WordPress dashboard under plugin section.</p>\n<p><strong>CSS Fixes</strong></p>\n<ul>\n<li>Gallery action messages CSS changed.</li>\n<li>Media upload link CSS updated.</li>\n<li>Fixed comment reply which was open by default with popup for few themes.</li>\n</ul>\n<p><strong>New Filters and Action</strong></p>\n<ul>\n<li><a href=\"http://docs.rtcamp.com/rtmedia/developers/hooks/rtmedia-hooks/action-to-add-admin-bar-media-sub-menu.html\">rtmedia_add_admin_bar_media_sub_menu</a></li>\n<li><a href=\"http://docs.rtcamp.com/rtmedia/developers/hooks/rtmedia-hooks/filter-to-share-media-description.html\">rtmedia_share_media_description</a></li>\n</ul>\n<h2>rtMedia URL Preview Addon</h2>\n<p><strong>Version 1.2.1</strong></p>\n<ul>\n<li>In this update we have added minified version of JS and CSS files along with expanded CSS style file which will be helpful to developer for understanding the CSS code.</li>\n<li><strong>Bug fixes:</strong> Close button to remove preview content and<span style=\"font-family: inherit; line-height: 1.5;\"> fixed dependency if option is not enable for activity upload.</span></li>\n</ul>\n<p><a href=\"https://rtcamp.com/products/rtmedia-activity-url-preview/\">Buy Addon</a></p>\n<h2>rtMedia Photo Tagging Addon</h2>\n<p>In rtMedia Photo Tagging 2.3, we have added some awesome features which our users have been waiting for:</p>\n<p><img class=\"aligncenter size-full wp-image-115589\" src=\"https://rtcamp-481283.c.cdn77.org/wp-content/uploads/2015/08/rtmedia-photo-tagging-users.png\" alt=\"rtmedia-photo-tagging-users\" width=\"690\" height=\"337\" /></p>\n<ul>\n<li>Displaying list of tagged users on photo along with link of user profile page.</li>\n<li>Media author and tagged person can remove themselves from tagged photo.</li>\n<li>Added new filter &#8211; <a href=\"http://docs.rtcamp.com/rtmedia/addons/rtmedia-photo-tagging/filters.html\">rtmedia_can_user_tag_photo</a>. Use this filter to allow or disallow other users to tag on photo.</li>\n<li>Fixed CSS issue for long username which was breaking the tagged box. Fixed user profile photo uploaded via BuddyPress profile picture was bigger in size during tag.</li>\n</ul>\n<p><a href=\"https://rtcamp.com/products/rtmedia-photo-tagging/\">Buy Addon</a></p>\n<h2>rtMedia 5 Star Rating Addon</h2>\n<p><strong>In version1.1.5 we released:</strong></p>\n<ul>\n<li>Minified JS and CSS files we added minified version of JS and CSS files along with expanded CSS style file which will be helpful to developer to understand CSS code.</li>\n<li><strong>Bug fixes:</strong> Average rating was not displaying for non logged in users.</li>\n</ul>\n<p><a href=\"https://rtcamp.com/products/rtmedia-star-ratings/\">Buy addon</a></p>\n<h2>rtMedia Upload Terms Addon</h2>\n<p><strong>Version 1.2 provided:</strong></p>\n<ul>\n<li>Minified JS and CSS files along with expanded CSS style file which will be helpful to developer to understand CSS code.</li>\n<li><strong>Bug Fixes:</strong> Validate page URL in admin setting.</li>\n</ul>\n<p><a href=\"https://rtcamp.com/products/rtmedia-upload-terms/\">Buy Addon</a></p>\n<p>These addons can be downloaded from <a href=\"https://rtcamp.com/my-account\">my-account</a> section. If you have already purchased these addons and the license key is activated on your site, you may have received update notification right inside your WordPress dashboard.</p>\n<p>Feel free to use our <a href=\"https://rtcamp.com/support/\">support</a> if you have any questions and feedback. We will be happy to assist you further.</p>\n<p><strong>Links: </strong><a href=\"https://wordpress.org/plugins/buddypress-media\">Download rtMedia Free version</a> | <a href=\"http://docs.rtcamp.com/rtmedia\">Docs</a> |<a href=\"http://demo.rtcamp.com/rtmedia/\"> Live Demo</a> | <a href=\"https://rtcamp.com/products/category/rtmedia/\">Premium Addons</a></p>\n<p>The post <a rel=\"nofollow\" href=\"https://rtcamp.com/blog/introducing-rtmedia-v3-8-15-addons/\">New Updates with rtMedia v 3.8.15 and Addons</a> appeared first on <a rel=\"nofollow\" href=\"https://rtcamp.com\">rtCamp</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://rtcamp.com/blog/introducing-rtmedia-v3-8-15-addons/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:29:\"https://rtcamp.com/blog/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"ap