	(5,3,'_messages','a:8:{s:12:\"mail_sent_ok\";s:66:\"پیام شما با موفقیت ارسال شد. متشکریم.\";s:12:\"mail_sent_ng\";s:170:\"ارسال پیام با شکست مواجه شد.لطفا بعدا امتحان کنید یا از روش های دیگری با مدیر سایت تماس بگیرید.\";s:16:\"validation_error\";s:167:\"خطای اعتبار سنجی رخ داده است. لطفا زمینه های الزامی را پر کرده و دوباره دکمه ی ارسال را بزنید.\";s:4:\"spam\";s:170:\"ارسال پیام با شکست مواجه شد.لطفا بعدا امتحان کنید یا از روش های دیگری با مدیر سایت تماس بگیرید.\";s:12:\"accept_terms\";s:60:\"برای ادامه لطفا شرایط را بپذیرید.\";s:16:\"invalid_required\";s:72:\"لطفا تمام زمینه های مورد نیاز را پر کنید\";s:16:\"invalid_too_long\";s:62:\"این ورودی بیش از حد طولانی می باشد.\";s:17:\"invalid_too_short\";s:53:\"این ورودی بیش از حد کوتاه است.\";}'),
