VALUES
	(1,1,'2015-10-26 06:19:00','2015-10-26 06:19:00','متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی متن تستی ','نوشته اول','','publish','closed','closed','','%d9%86%d9%88%d8%b4%d8%aa%d9%87-%d8%a7%d9%88%d9%84','','','2015-10-26 08:52:13','2015-10-26 08:52:13','',0,'/?p=1',0,'post','',0),
	(2,1,'2015-10-26 06:19:00','2015-10-26 06:19:00','این یک برگه‌ی نمونه است که با یک نوشته در وبلاگ تفاوت دارد زیرا برگه‌ها در یک مکان ثابت می‌مانند و معمولاً در فهرست پیوندهای درونی سایت شما نمایش داده می‌شوند (در اکثر پوسته‌ها). بیشتر افراد کار کردن با برگه‌ها را از یک برگه‌ی «درباره من» که آن‌ها را به خوانندگان سایت معرفی می‌کند، شروع می‌کنند. برای مثال این‌چنین می‌گویند:\n\n<blockquote>سلام دوستان، من روزها یک کارمند اداری هستم و شب‌ها یک راننده تاکسی، این وبلاگ من است. من در اهواز زندگی می‌کنم که شهری در جنوب غربی ایران است.</blockquote>\n\nیا چیزی شبیه این:\n\n<blockquote>شرکت XYZ در سال ۱۳۶۵ تاسیس شد و ارائه‌دهنده محصولات صنعتی است. این شرکت ۲۰۰۰ کارگر و کارمند دارد. امیدواریم از محصولات ما راضی باشید.</blockquote>\n\nبه‌عنوان یک کاربر تازه‌ی وردپرس فارسی شما برای پاک کردن این برگه و ساختن برگه‌های تازه می‌توانید به <a href=\"/wp-admin/\">پیشخوان خود</a> مراجعه کنید. موفق باشید!','برگه نمونه','','publish','open','open','','برگه-نمونه','','','2015-10-26 06:19:00','2015-10-26 06:19:00','',0,'/?page_id=2',0,'page','',0),
	(3,0,'2015-10-26 06:19:01','2015-10-26 06:19:01','<p>نام شما (الزامی)<br />\n    [text* your-name] </p>\n\n<p>ایمیل شما (الزامی)<br />\n    [email* your-email] </p>\n\n<p>موضوع<br />\n    [text your-subject] </p>\n\n<p>پیام شما<br />\n    [textarea your-message] </p>\n\n<p>[submit \"ارسال \"]</p>\n[your-subject]\n[your-name] \nاز : [your-name] \nموضوع: [your-subject]\n\nمحتوای پیام :\n[your-message]\n\n--\nاین ایمیل از فرم تماس در شرکت داده ورزان مجازی پارسیان ارسال شده است.\nsth@sth.com\nReply-To: [your-email]\n\n0\n0\n\n[your-subject]\nشرکت داده ورزان مجازی پارسیان \nمحتوای پیام :\n[your-message]\n\n--\nاین ایمیل از فرم تماس در شرکت داده ورزان مجازی پارسیان ارسال شده است.\n[your-email]\nReply-To: sth@sth.com\n\n0\n0\nپیام شما با موفقیت ارسال شد. متشکریم.\nارسال پیام با شکست مواجه شد.لطفا بعدا امتحان کنید یا از روش های دیگری با مدیر سایت تماس بگیرید.\nخطای اعتبار سنجی رخ داده است. لطفا زمینه های الزامی را پر کرده و دوباره دکمه ی ارسال را بزنید.\nارسال پیام با شکست مواجه شد.لطفا بعدا امتحان کنید یا از روش های دیگری با مدیر سایت تماس بگیرید.\nبرای ادامه لطفا شرایط را بپذیرید.\nلطفا تمام زمینه های مورد نیاز را پر کنید\nاین ورودی بیش از حد طولانی می باشد.\nاین ورودی بیش از حد کوتاه است.','فرم تماس 1','','publish','closed','closed','','%d9%81%d8%b1%d9%85-%d8%aa%d9%85%d8%a7%d8%b3-1','','','2015-10-26 06:19:01','2015-10-26 06:19:01','',0,'/?post_type=wpcf7_contact_form&p=3',0,'wpcf7_contact_form','',0),
	(4,1,'2015-10-26 06:19:23','0000-00-00 00:00:00','','پیش‌نویس خودکار','','auto-draft','open','open','','','','','2015-10-26 06:19:23','0000-00-00 00:00:00','',0,'/?p=4',0,'post','',0),
